%spark2.pyspark
from pyspark.sql import functions as f
from datetime import datetime
import matplotlib.dates as mdates
import matplotlib.pyplot as plt

class Record:
    def __init__(self, anomaly, error, dateGMT, timeGMT, sampleMeasurement, prediction):
        self.anomaly = anomaly
        self.error = error
        self.dateGMT = dateGMT
        self.timeGMT = timeGMT
        self.sampleMeasurement = sampleMeasurement
        self.prediction = prediction

class RecordCollection:
    def __init__(self, partitionKey, methodName, parameterName, records):
        self.partitionKey = partitionKey
        self.methodName = methodName
        self.parameterName = parameterName
        self.records = records
        self.anomalyTrashHold = 0.1

    def buildMeasurementData(self):
        values = [record.sampleMeasurement for record in self.records]
        dates = self.buildDates()
        return (dates, values)

    def buildErrorData(self):
        values = [record.error for record in self.records]
        dates = self.buildDates()
        return (dates, values)

    def buildAnomalyData(self):
        values = [record.anomaly for record in self.records]
        dates = self.buildDates()
        return (dates, values)

    def buildPredictionData(self):
        values = [record.prediction for record in self.records]
        dates = self.buildDates()
        return (dates, values)

    def buildDates(self):
        # return mdates.date2num([datetime.strptime(record.dateGMT + " " + record.timeGMT, '%Y-%m-%d %H:%M') for record in self.records])
        return [i for i, record in enumerate(self.records)]

    def buildAnomalyTrashholdData(self):
        values = [record.sampleMeasurement for record in self.records if record.anomaly >= self.anomalyTrashHold]
        dates = [i for i, record in enumerate(self.records) if record.anomaly >= self.anomalyTrashHold]
        return (dates, values)

